import React from 'react';
import LoginForm from '../components/LoginForm';

function LoginPage() {
  return (
    <div style={{ textAlign: 'center', marginTop: '50px' }}>
      <h1>OralVis Healthcare</h1>
      <LoginForm />
    </div>
  );
}

export default LoginPage;
